const BcInfo = () => {
  const [enteredName, setEnteredName] = useState();
  const [enteredTitle, setEnteredTitle] = useState();
  const [enteredOffice, setEnteredOffice] = useState();
  const [enteredMsc, setEnteredMsc] = useState();
  const [enteredOfficePhone, setEnteredOfficePhone] = useState();
  const [enteredOtherPhone, setEnteredOtherPhone] = useState();
  const [enteredEmail, setEnteredEmail] = useState();

  const nameChangeHandler = event => {
    setEnteredName(event.target.value)
  };
  const titleChangeHandler = event => {
    setEnteredTitle(event.target.value)
  };
  const officeChangeHandler = event => {
    setEnteredOffice(event.target.value)
  };
  const mscChangeHandler = event => {
    setEnteredMsc(event.target.value)
  };
  const officePhoneChangeHandler = event => {
    setEnteredOfficePhone(event.target.value)
  };
  const otherPhoneChangeHandler = event => {
    setEnteredOtherPhone(event.target.value)
  };
  const emailChangeHandler = event => {
    setEnteredEmail(event.target.value)
  };

  return (
    <div>
      <h1>Business Card Information</h1>

      <label>First & Last Name</label>
      <input type="text" id="name" onChange ={nameChangeHandler}></input>

      <label>Title</label>
      <input type="text" id ="title" onChange={titleChangeHandler}></input>

      <label>Office Name</label>
      <input type="text" id ="officeName" onChange={officeChangeHandler}></input>

      <label>Mail Stop Code</label>
      <input type="text" id ="msc" onChange={mscChangeHandler}></input>

      <label>Office Phone</label>
      <input type="tel" id ="officePhone" onChange={officePhoneChangeHandler}></input>

      <label>Other Phone</label>
      <input type="tel" id ="otherPhone" onChange={otherPhoneChangeHandler}></input>

      <label>Email</label>
      <input type="email" id ="email" onChange={emailChangeHandler}></input>
    </div>
  );
};
export default BcInfo;
